const updatePublishersList = (state, action) => {

    if(state === undefined) {
        return {
            publishers : [],
            loading : true,
            error : false,
            addPublisher : "",
            editPublisher : "",
            selectedItem : null
        }
    }

};

export default updatePublishersList;
